Message: Plugin Settings Configuration
This message is sent by the server, when it wants to know what properties need to be stored in the plugin settings, for this plugin.
Request - From the server
Request name: go.plugin-settings.get-configuration
Request parameters: empty
Request headers: empty
Request body: empty
Response - From the plugin
Expected response body: The Plugin Settings configuration of this plugin is expected in the response. It contains a field, and a set of options for each of them. The options are:

display-name: [String] This option is used in creating UI, to describe the property.

display-order: [String] This option is used in creating UI, to decide on the order in which the properties need to be displayed.

default-value: [String] If the user provides no input to this field, then the value of this property will be stored.

secure: [Boolean] Should the data for this field (provided by the user) stored securely (encrypted)?

required: [Boolean] Is this a required field?


Example response:
{
    "SERVER_URL": {
        "display-name": "Server URL",
        "display-order": "0"
    },
    "USERNAME": {
        "required": false,
        "display-name": "Username",
        "display-order": "1"
    },
    "PASSWORD": {
        "secure": true,
        "required": false,
        "display-name": "Password",
        "display-order": "2"
    }
}

Schema information
JSON schema of expected response:
{
    "$schema": "http://json-schema.org/draft-04/schema#",
    "id": "/",
    "type": "object",
    "patternProperties": {
        "^[a-zA-Z0-9_-]+$": {
            "type": [
                "object",
                "null"
            ],
            "properties": {
                "default-value": {
                    "type": "string",
                    "required": false,
                    "default": "",
                    "pattern": "^[a-zA-Z0-9_-]+$"
                },
                "secure": {
                    "type": "boolean",
                    "required": false,
                    "default": false,
                },
                "required": {
                    "type": "boolean",
                    "required": false,
                    "default": true
                },
                "display-name": {
                    "type": "string",
                    "required": false,
                    "pattern": "^[a-zA-Z0-9_-]+$"
                },
                "display-order": {
                    "type": "string",
                    "required": false,
                    "pattern": "^[0-9]+$"
                }
            },
            "additionalProperties": false
        }
    },
    "additionalProperties": false
}

Message: Validate Plugin Settings
Request - From the server
Request name: go.plugin-settings.validate-configuration
Request parameters: empty
Request headers: empty
Request body: This contains information about the Plugin Settings provided by the user. The keys in the maps correspond to the keys provided by the plugin, as a part of the response to "Plugin Settings Configuration" message.
Example request:
{
    "plugin-settings": {
        "SERVER_URL": {
            "value": "http://localhost.com"
        },
        "USERNAME": {
            "value": "user"
        },
        "PASSWORD": {
            "value": "password"
        }
    }
}

Response - From the plugin
Expected response body: The plugin is expected to send a response, which contains a list of errors in the Plugin Settings configuration, one message for every key in the request. It can also send an empty list, ie [], if the configuration is valid.
Example response:
[
    {
        "key": "SERVER_URL",
        "message": "Server URL not specified"
    },
    {
        "key": "RANDOM",
        "message": "Unsupported key(s) found : RANDOM. Allowed key(s) are : SERVER_URL, USERNAME, PASSWORD"
    }
]

Schema information
JSON schema of request from the server:
{
    "$schema": "http://json-schema.org/draft-04/schema#",
    "id": "/",
    "type": "object",
    "properties": {
        "plugin-settings": {
             "type": "object",
             "patternProperties": {
                 "^[a-zA-Z0-9_-]+$": {
                     "type": [
                         "object",
                         "null"
                     ],
                     "properties": {
                         "value": {
                             "type": "string",
                             "pattern": "^[a-zA-Z0-9_-]+$"
                         }
                     },
                     "additionalProperties": false
                 }
             },
             "additionalProperties": false
         }
    },
    "additionalProperties": false
}

JSON schema of expected response:
{
    "$schema": "http://json-schema.org/draft-04/schema#",
    "id": "/",
    "required": false,
    "type": "array",
    "items": {
        "type": "object",
        "required": false,
        "properties": {
            "key": {
                "type": "string",
                "required": true
            },
            "message": {
                "type": "string",
                "required": true
            }
        }
    },
    "minItems": 0,
    "uniqueItems": true
}

